import '../styles/home/home.css';

function connexion() {
    return (
        <body>
        <h1 className="title">Page d'accueil</h1>
        <div className='nav_buttonins_home'> 
            <input type="text" />
            <button type="button">Click Me!</button>
        </div>
        </body>
    );
    
}

export default connexion
